import React from "react";
import { useState } from "react";
import emailjs from "emailjs-com";
import { motion } from "framer-motion";
import logo from "./assets/logo.png";
import qr from "./assets/qr.png";

export default function App() {
  const [formData, setFormData] = useState({
    name: "",
    email: "",
    whatsapp: "",
    confirmWhatsapp: "",
    occupation: "",
    date1: "",
    date2: "",
    date3: "",
    message: "",
    file: null,
  });

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]: files ? files[0] : value,
    }));
  };

  const sendEmail = (e) => {
    e.preventDefault();
    emailjs.sendForm(
      "your_service_id",
      "your_template_id",
      e.target,
      "your_user_id"
    )
      .then((result) => {
        alert("Booking confirmed! Check your email.");
      })
      .catch((error) => {
        alert("Failed to send. Try again.");
      });
  };

  return (
    <div className="bg-white font-sans text-gray-800">
      {/* Header */}
      <header className="flex items-center justify-between p-4 shadow-md">
        <div>
          <h1 className="text-xl font-bold">Ghar Ki Baat</h1>
          <p className="text-sm italic text-gray-600">When no one listens, we do.</p>
        </div>
        <img src={logo} alt="Logo" className="w-16 h-16" />
      </header>

      {/* Hero */}
      <section className="flex flex-col md:flex-row items-center justify-between p-8 bg-teal-50">
        <div className="max-w-xl">
          <h2 className="text-3xl font-bold mb-2">Confidential Conversations</h2>
          <p className="text-lg">Book a private session with a trusted listener.</p>
        </div>
        <motion.img
          src={logo}
          alt="Animated Logo"
          className="w-32 h-32"
          animate={{ rotate: [0, 10, -10, 0] }}
          transition={{ duration: 4, repeat: Infinity }}
        />
      </section>

      {/* Pricing */}
      <section className="p-6 bg-gray-100 text-center">
        <h2 className="text-2xl font-bold mb-4">Our Pricing</h2>
        <div className="flex flex-col md:flex-row gap-6 justify-center">
          <div className="bg-white p-4 shadow-md rounded">
            <p className="font-bold text-xl">₹99</p>
            <p className="text-sm">One-time 15 min call</p>
          </div>
          <div className="bg-white p-4 shadow-md rounded">
            <p className="font-bold text-xl">₹199</p>
            <p className="text-sm">30 min deep conversation</p>
          </div>
          <div className="bg-white p-4 shadow-md rounded">
            <p className="font-bold text-xl">₹299</p>
            <p className="text-sm">50 min voice/video session</p>
          </div>
        </div>
      </section>

      {/* Book a Session */}
      <section className="p-6">
        <h2 className="text-2xl font-bold mb-4">Book a Session</h2>
        <form onSubmit={sendEmail} className="grid gap-4 max-w-xl mx-auto">
          <input type="text" name="name" placeholder="Your Name" onChange={handleChange} required className="p-2 border rounded" />
          <input type="email" name="email" placeholder="Your Email" onChange={handleChange} required className="p-2 border rounded" />
          <input type="text" name="whatsapp" placeholder="WhatsApp Number" onChange={handleChange} required className="p-2 border rounded" />
          <input type="text" name="confirmWhatsapp" placeholder="Confirm WhatsApp Number" onChange={handleChange} required className="p-2 border rounded" />
          
          <select name="occupation" onChange={handleChange} required className="p-2 border rounded">
            <option value="">Current Occupation</option>
            <option value="Student">Student</option>
            <option value="Working Professional">Working Professional</option>
            <option value="Job Seeker">Job Seeker</option>
            <option value="Other">Other</option>
          </select>

          <input type="text" name="date1" placeholder="Preferred Date & Time 1" onChange={handleChange} required className="p-2 border rounded" />
          <input type="text" name="date2" placeholder="Preferred Date & Time 2" onChange={handleChange} className="p-2 border rounded" />
          <input type="text" name="date3" placeholder="Preferred Date & Time 3" onChange={handleChange} className="p-2 border rounded" />

          <textarea name="message" placeholder="Any Message (Optional)" onChange={handleChange} className="p-2 border rounded"></textarea>

          <div>
            <label className="block font-bold mb-1">Upload payment success image</label>
            <input type="file" name="file" onChange={handleChange} className="p-2 border rounded" />
          </div>

          <div className="flex items-center gap-4">
            <img src={qr} alt="QR Code" className="w-32 h-32 border p-2 rounded" />
            <p className="text-sm">Scan to pay before booking</p>
          </div>

          <button type="submit" className="bg-teal-600 text-white py-2 rounded hover:bg-teal-700">
            Submit Booking
          </button>
          <p className="text-sm text-gray-600">You'll receive booking confirmation on WhatsApp within a few hours.</p>
        </form>
      </section>

      {/* Why Trust Us */}
      <section className="p-6 bg-gray-50 text-center">
        <h2 className="text-2xl font-bold mb-4">Why Trust Us?</h2>
        <p>Private. Non-judgemental. Listeners who care.</p>
      </section>

      {/* Testimonials */}
      <section className="p-6 text-center">
        <h2 className="text-2xl font-bold mb-4">What People Say</h2>
        <div className="flex flex-col gap-4 md:flex-row justify-center">
          <blockquote className="bg-white p-4 rounded shadow">“Helped me in my worst time.” <br /><span className="text-sm text-gray-500">– Anonymous</span></blockquote>
          <blockquote className="bg-white p-4 rounded shadow">“No judgment. Just listening.” <br /><span className="text-sm text-gray-500">– Name Hidden</span></blockquote>
        </div>
      </section>

      {/* CTA */}
      <section className="p-6 bg-teal-600 text-white text-center">
        <h2 className="text-2xl font-bold mb-2">Need to talk?</h2>
        <p>Book a confidential session now. We're here for you.</p>
      </section>

      {/* Footer */}
      <footer className="p-4 text-center text-sm text-gray-500">
        © 2025 Ghar Ki Baat. All rights reserved.
      </footer>
    </div>
  );
}
